// client/src/App.js

import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/getAllNotes").then((response) => {
      if (response.ok) {
        return response.json();
      }
      throw new Error("Error " + response.status + " al llamar al API: " + response.statusText);
    })
    .then((responseJson) => {
      setData(responseJson);
    })
    .catch((error) => {
      console.error(error)
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{!data ? "Loading..." : data}</p>
      </header>
      <div>
        {data == null || data.length == 0 && <p>No hay datos para mostrar.</p>}
        {data.length > 0 ? (
          <ul>
            {data.map((objeto, index) => (
              <li key={index}>
                <strong>ID:</strong> {objeto.id}<br />
                <strong>Nombre:</strong> {objeto.nombre}<br />
                <strong>Descripción:</strong> {objeto.descripcion}<br />
              </li>
            ))}
          </ul>
        ) : (
          <p>No hay datos disponibles.</p>
        )}
        <ul>
          {data.map((item) => (
            <li key={item.id}>
              <strong>ID:</strong> {item.id}<br />
              <strong>Nombre:</strong> {item.nombre}<br />
              <strong>Descripción:</strong> {item.texto}<br />
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default App;
